import axios from 'axios';
import React from 'react';
import { useEffect } from 'react';
import InputFilters from './InputFilters';
import '../../styles/elemon.css';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Box, cardClasses } from '@mui/material';
const getElemonItem = (pageNumber = 1, pageSize = 20, priceMode = 2, baseCardId, tokenId, rarities, classes, purities) => {
    return axios.get(`https://app.elemon.io/market/getElemonItems?pageNumber=${pageNumber}&pageSize=${pageSize}&positionType=2&priceMode=${priceMode}&baseCardId=&tokenId=&rarities=&classes=&purities=`).then(res => res.data, {
        headers: {
            "Access-Control-Allow-Origin": "*"
        }
    });
}
const getElemonInfo = (listElemon,amount) => {
    const listTokenId = listElemon.splice(1, amount).map(token => token.tokenId)
    return axios.get(`https://app.elemon.io/elemon/GetElemonInfo?tokenId=${listTokenId.join(',')}`).then(res => res.data, {
        headers: {
            "Access-Control-Allow-Origin": "*"
        }
    });
}

const Elemon = () => {

    useEffect(() => {
        let pageNumber = 1;
        const getData = async () => {
            await getElemonItem(pageNumber, 100).then(async (res) => {
                // console.log(res.paging.totalCount, res.data[0].tokenId)
                const list = await getElemonItem(1, res.paging.totalCount).then(res => res.data);
                // console.log(list)
                
                getElemonInfo(list,10).then(res => console.log(res.data));
            });
        }
        getData();
    })

    return (
        <Box>
            <InputFilters />
            <Box sx={{ textAlign: 'left' }}>
                <InputSelect />
                <TableContainer id='table-scroll' component={Paper}>
                    <Table id='tablePrice' aria-label="simple table">
                        <TableHead>
                            <TableRow>
                                <TableCell align="center">#</TableCell>
                                <TableCell align="center">

                                </TableCell>
                                <TableCell align="center">
                                    ID
                                </TableCell>
                                <TableCell align="center">
                                    Score
                                </TableCell>
                                <TableCell align="center">
                                    Level
                                </TableCell>
                                <TableCell align="center" sx={{ width: '25%' }}>
                                    Price
                                </TableCell>
                            </TableRow>
                        </TableHead>
                        <TableBody>
                            {listShow && listShow.map((metamon, index) => {
                                return (
                                    <TableRow key={index + 1}>
                                        <TableCell align="center" component="th" scope="row">{index + 1}</TableCell>
                                        <TableCell id={`metamon-${index + 1}`} onMouseEnter={showInfo} align="center" component="th" scope="row" sx={{ position: 'relative' }}>
                                            <img width='50px' height='50px' src={metamon.image_url} alt='Metamon' />
                                        </TableCell>
                                        <TableCell align="center" component="th" scope="row">
                                            <a href={`https://market.radiocaca.com/#/market-place/${metamon.id}`} target='_blank'
                                                style={{ color: '#363636', textDecoration: 'none' }}
                                                rel="noreferrer"
                                            >
                                                {metamon.token_id}</a></TableCell>
                                        <TableCell align="center" component="th" scope="row">{metamon?.score}</TableCell>
                                        <TableCell align="center" component="th" scope="row">{metamon?.level}</TableCell>
                                        <TableCell align="center" component="th" scope="row">{numberWithCommas(metamon.fixed_price)} (~{(raca * metamon.fixed_price).toFixed(2)})</TableCell>
                                    </TableRow>
                                )
                            })}
                        </TableBody>
                    </Table>
                </TableContainer>
            </Box>
        </Box>
    );
};

export default Elemon;
